import React from "react";
import "../css/search.css";

const Search = () => {
    return (
        <React.Fragment>
            <form className="search_wrap" onSubmit={handleSearch}>
                <input 
                type="text" placeholder="장소 검색" 
                />
                <button type="submit">검색</button>
            </form>
        </React.Fragment>
    )
}

export default Search;
